function d(r){if(!r)return"";try{const t=new Date(r),n=t.getFullYear(),o=(t.getMonth()+1).toString().padStart(2,"0"),e=t.getDate().toString().padStart(2,"0"),a=t.getHours().toString().padStart(2,"0"),s=t.getMinutes().toString().padStart(2,"0"),c=t.getSeconds().toString().padStart(2,"0");return`${n}-${o}-${e} ${a}:${s}:${c}`}catch(t){return console.error("时间格式化错误:",t),r}}export{d as f};
